import React, { useState, useEffect } from "react";

function Valikot(props) {
  const lisaaPaikat = () => {
    console.log("paikat:", props);
    const maakunnat = [props.paikat];
    maakunnat.map((paikka) => {
      let jsonObject = JSON.parse(JSON.stringify(paikka));
      console.log("json:", jsonObject.maakunta);
      //console.log("Paikka:", JSON.parse(JSON.stringify(paikka)));
      return <option value={paikka.maakunta}></option>;
    });
  };

  return (
    <div>
      <select>{lisaaPaikat()}</select>
    </div>
  );
}

export default Valikot;
